import { jsPDF } from "jspdf";
var font =
  "";
var callAddFont = function () {
  this.addFileToVFS("Updock-Regular-normal.ttf", font);
  this.addFont("Updock-Regular-normal.ttf", "Updock-Regular", "normal");
};
jsPDF.API.events.push(["addFonts", callAddFont]);
export const addpp = () => {
  jsPDF.API.events.push(["addFonts", callAddFont]);
};
